import classes from './AvailableMeals.module.css';

const DUMMY_MEALS = [
    {
        id: 'm1',
        name: 'Sushi',
        description: 'Finest fish and veggies',
        price: 22.99,
    },
    {
        id: 'm2',
        name: 'Schnitzel',
        description: 'A german specialty',
        price: 16.5,
    },
    {
        id: 'm3',
        name: 'Barbecu Burger',
        description: 'American, raw, meaty',
        price: 12.99,
    },
    {
        id: 'm4',
        name: 'Green Bow;',
        description: 'Helathy...and green...',
        price: 18.99,
    },
]


const AvailableMeals = () => {
    const listMeals = DUMMY_MEALS.map(meal => <li key={meal.id}>{meal.name}</li>)
    return (
        <section className={classes.meals-list}>
            <ul>
                {listMeals}
            </ul>
        </section>
    )
}

export default AvailableMeals;
